import React,{ useEffect} from 'react';
import Aos from 'aos';
import "aos/dist/aos.css";
import {Link} from 'react-router-dom';
import { Dropdown } from 'semantic-ui-react'

   
function FavoritesItem(props){


  useEffect(()=>{
    Aos.init({duration: 2000 });
},[])


const friendOptions = [
  {
    key: 'Jenny Hess',
    text: 'Jenny Hess',
    value: 'Jenny Hess',
    image: { avatar: true, src: '/images/avatar/small/jenny.jpg' },
  },
  {
    key: 'Elliot Fu',
    text: 'Elliot Fu',
    value: 'Elliot Fu',
    image: { avatar: true, src: '/images/avatar/small/elliot.jpg' },
  },
  {
    key: 'Stevie Feliciano',
    text: 'Stevie Feliciano',
    value: 'Stevie Feliciano',
    image: { avatar: true, src: '/images/avatar/small/stevie.jpg' },
  },
  {
    key: 'Christian',
    text: 'Christian',
    value: 'Christian',
    image: { avatar: true, src: '/images/avatar/small/christian.jpg' },
  },
  {
    key: 'Matt',
    text: 'Matt',
    value: 'Matt',
    image: { avatar: true, src: '/images/avatar/small/matt.jpg' },
  },
  {
    key: 'Justen Kitsune',
    text: 'Justen Kitsune',
    value: 'Justen Kitsune',
    image: { avatar: true, src: '/images/avatar/small/justen.jpg' },
  },
]

const DropdownExampleSelection = () => (
  <Dropdown
    placeholder='Select Friend'
    fluid
    selection
    options={friendOptions}
  />
)







  return(
  <div>
    <head>
    <link rel="stylesheet" href="./favorites.css" ></link>
</head>
      
       <div className='wrapper' data-aos="fade-up">
        
         
      
        <Link to={`/movie/${props.id}`}><img  className="mimg" src={props.img} alt=''/></Link>
                                        <p className="movieTitle">{props.title}  - {props.year}</p>
  
        

           
           <div role="listbox" aria-expanded="false" className="ui fluid selection dropdown" tabindex="0"><div aria-atomic="true" aria-live="polite" role="alert" className="divider default text">Select Friend</div>
           <i aria-hidden="true" className="dropdown icon"></i><div className="menu transition"><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="true" className="selected item">
           <img src="/images/avatar/small/jenny.jpg" className="ui avatar image"/><span className="text">Jenny Hess</span></div><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="false" className="item">
           <img src="/images/avatar/small/elliot.jpg" className="ui avatar image"/><span className="text">Elliot Fu</span></div><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="false" className="item">
           <img src="/images/avatar/small/stevie.jpg" className="ui avatar image"/><span className="text">Stevie Feliciano</span></div><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="false" className="item">
           <img src="/images/avatar/small/christian.jpg" className="ui avatar image"/><span className="text">Christian</span></div><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="false" className="item">
           <img src="/images/avatar/small/matt.jpg" className="ui avatar image"/><span className="text">Matt</span></div><div style="pointer-events:all" role="option" aria-checked="false" aria-selected="false" className="item">
           <img src="/images/avatar/small/justen.jpg" className="ui avatar image"/><span className="text">Justen Kitsune</span></div></div></div>

           
           </div>
           

        </div>
        
  );
             
    
}      
  
    


export default FavoritesItem
